　（中の正確な列定義を抽出してマッピング表を作成します）
→お願い

JSONマッピングは**固定値「ブーケフレーム加工品」**を含める以外に、
　他の列も固定値にしたいもの（例：「クール区分」「運賃管理番号」など）はありますか？

